import React from 'react';

function BulletDescription(props) {
  let combined = props.descriptions.map(description => (
    <li>
      <span>
        <h5>{description}</h5>
      </span>
    </li>
  ));
  return (
    <div className="description">
      <ol>{combined}</ol>
    </div>
  );
}

export default BulletDescription;
